-- Table structure for bangtuitui_py_coupon
-- ----------------------------
DROP TABLE IF EXISTS `bangtuitui_py_coupon`;
CREATE TABLE `bangtuitui_py_coupon`  (
  `coupon_id` int UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '优惠券id',
  `name` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '优惠券名称',
  `color` tinyint UNSIGNED NOT NULL DEFAULT 10 COMMENT '优惠券颜色(10蓝 20红 30紫 40黄)',
  `coupon_type` tinyint UNSIGNED NOT NULL DEFAULT 10 COMMENT '优惠券类型(10满减券 20折扣券)',
  `reduce_price` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '满减券-减免金额',
  `discount` tinyint UNSIGNED NOT NULL DEFAULT 0 COMMENT '折扣券-折扣率(0-100)',
  `min_price` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '最低消费金额',
  `expire_type` tinyint UNSIGNED NOT NULL DEFAULT 10 COMMENT '到期类型(10领取后生效 20固定时间)',
  `expire_day` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '领取后生效-有效天数',
  `start_time` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '固定时间-开始时间',
  `end_time` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '固定时间-结束时间',
  `apply_range` tinyint UNSIGNED NOT NULL DEFAULT 10 COMMENT '适用范围(10全部商品 20指定商品 30指定分类)',
  `product_ids` longtext CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL COMMENT '限制商品id',
  `category_ids` longtext CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL COMMENT '限制分类id',
  `total_num` int NOT NULL DEFAULT 0 COMMENT '发放总数量(-1为不限制)',
  `receive_num` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '已领取数量',
  `sort` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '排序方式(数字越小越靠前)',
  `show_center` tinyint NULL DEFAULT 1 COMMENT '是否显示领券中心，0否1是',
  `free_limit` tinyint NULL DEFAULT 0 COMMENT '优惠限制0不显示1不可与促销同时2不可与等级优惠同时3不可于促销和等级同时',
  `is_delete` tinyint UNSIGNED NOT NULL DEFAULT 0 COMMENT '软删除',
  `app_id` int UNSIGNED NULL DEFAULT 0 COMMENT '程序id',
  `create_time` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '创建时间',
  `update_time` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '更新时间',
  PRIMARY KEY (`coupon_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb3 COLLATE = utf8mb3_general_ci COMMENT = '优惠券记录表' ROW_FORMAT = COMPACT;

