-- ----------------------------
-- Table structure for bangtuitui_py_order
-- ----------------------------
DROP TABLE IF EXISTS `bangtuitui_py_order`;
CREATE TABLE `bangtuitui_py_order`  (
  `order_id` int UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '订单id',
  `order_no` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '订单号',
  `total_price` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '商品总金额(不含优惠折扣)',
  `order_price` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '订单金额(含优惠折扣)',
  `coupon_id` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '优惠券id',
  `coupon_money` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '优惠券抵扣金额',
  `points_money` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '积分抵扣金额',
  `points_num` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '积分抵扣数量',
  `pay_price` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '实际付款金额(包含运费)',
  `update_price` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '后台修改的订单金额（差价）',
  `fullreduce_money` double(10, 2) NULL DEFAULT 0.00 COMMENT '满减金额',
  `fullreduce_remark` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT '' COMMENT '满减备注',
  `product_reduce_money` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '商品满减总额',
  `buyer_remark` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '买家留言',
  `pay_type` tinyint UNSIGNED NOT NULL DEFAULT 20 COMMENT '支付方式(10余额支付 20微信支付)',
  `pay_source` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT '' COMMENT '支付来源,mp,wx',
  `pay_status` tinyint UNSIGNED NOT NULL DEFAULT 10 COMMENT '付款状态(10未付款 20已付款)',
  `pay_time` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '付款时间',
  `pay_end_time` int NULL DEFAULT 0 COMMENT '支付截止时间',
  `delivery_type` tinyint UNSIGNED NOT NULL DEFAULT 10 COMMENT '配送方式(10快递配送 20上门自提 30无需物流)',
  `extract_store_id` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '自提门店id',
  `extract_clerk_id` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '核销店员id',
  `express_price` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '运费金额',
  `express_id` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '物流公司id',
  `express_company` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '物流公司',
  `express_no` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '物流单号',
  `delivery_status` tinyint UNSIGNED NOT NULL DEFAULT 10 COMMENT '发货状态(10未发货 20已发货)',
  `delivery_time` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '发货时间',
  `receipt_status` tinyint UNSIGNED NOT NULL DEFAULT 10 COMMENT '收货状态(10未收货 20已收货)',
  `receipt_time` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '收货时间',
  `order_status` tinyint UNSIGNED NOT NULL DEFAULT 10 COMMENT '订单状态10=>进行中，20=>已经取消，30=>已完成',
  `points_bonus` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '赠送的积分数量',
  `is_settled` tinyint UNSIGNED NOT NULL DEFAULT 0 COMMENT '订单是否已结算(0未结算 1已结算)',
  `transaction_id` varchar(30) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '微信支付交易号',
  `is_comment` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否已评价(0否 1是)',
  `order_source` tinyint UNSIGNED NOT NULL DEFAULT 10 COMMENT '订单来源(10普通 20积分 30拼团 40砍价 50秒杀 60礼包购)',
  `user_id` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '用户id',
  `is_refund` tinyint NULL DEFAULT 0 COMMENT '拼团等活动失败退款',
  `assemble_status` tinyint NULL DEFAULT 0 COMMENT '拼团状态 10拼单中 20拼单成功 30拼单失败',
  `activity_id` int NULL DEFAULT 0 COMMENT '活动id，对应拼团，秒杀，砍价活动id',
  `is_agent` tinyint NULL DEFAULT 0 COMMENT '是否可以分销0否1是',
  `cancel_remark` varchar(200) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '商家取消订单备注',
  `virtual_auto` tinyint NOT NULL DEFAULT 0 COMMENT '是否自动发货1自动0手动',
  `virtual_content` varchar(200) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '虚拟物品内容',
  `balance` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '余额抵扣金额',
  `online_money` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '在线支付金额',
  `refund_money` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '退款金额',
  `trade_no` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '支付订单号',
  `wx_delivery_status` tinyint UNSIGNED NOT NULL DEFAULT 10 COMMENT '微信发货状态(10未发货 20已发货)',
  `is_delete` tinyint UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否删除',
  `app_id` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '小程序id',
  `create_time` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '创建时间',
  `update_time` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '更新时间',
  PRIMARY KEY (`order_id`) USING BTREE,
  UNIQUE INDEX `order_no`(`order_no` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb3 COLLATE = utf8mb3_general_ci COMMENT = '订单记录表' ROW_FORMAT = COMPACT;

