  `coupon_money` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '优惠券折扣金额',
  `points_money` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '积分金额',
  `points_num` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '积分抵扣数量',
