-- ----------------------------
-- Table structure for bangtuitui_py_product
-- ----------------------------
DROP TABLE IF EXISTS `bangtuitui_py_product`;
CREATE TABLE `bangtuitui_py_product`  (
  `product_id` int UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '产品id',
  `product_name` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '产品名称',
  `product_price` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '产品一口价',
  `product_no` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT '' COMMENT '产品编码',
  `product_stock` int NULL DEFAULT 0 COMMENT '产品总库存',
  `video_id` int NULL DEFAULT 0 COMMENT '视频id',
  `poster_id` int NULL DEFAULT 0 COMMENT '视频封面id',
  `selling_point` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT '' COMMENT '商品卖点',
  `category_id` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '产品分类id',
  `spec_type` tinyint UNSIGNED NOT NULL DEFAULT 0 COMMENT '产品规格(10单规格 20多规格)',
  `deduct_stock_type` tinyint UNSIGNED NOT NULL DEFAULT 20 COMMENT '库存计算方式(10下单减库存 20付款减库存)',
  `content` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '产品详情',
  `sales_initial` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '初始销量',
  `sales_actual` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '实际销量',
  `product_sort` int UNSIGNED NOT NULL DEFAULT 100 COMMENT '产品排序(数字越小越靠前)',
  `delivery_id` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '配送模板id',
  `is_points_gift` tinyint UNSIGNED NOT NULL DEFAULT 1 COMMENT '是否开启积分赠送(1开启 0关闭)',
  `is_points_discount` tinyint UNSIGNED NOT NULL DEFAULT 1 COMMENT '是否允许使用积分抵扣(1允许 0不允许)',
  `max_points_discount` int NULL DEFAULT 0 COMMENT '最大积分抵扣数量',
  `is_enable_grade` tinyint UNSIGNED NOT NULL DEFAULT 1 COMMENT '是否开启会员折扣(1开启 0关闭)',
  `is_alone_grade` tinyint NULL DEFAULT 0 COMMENT '会员折扣设置(0默认等级折扣 1单独设置折扣)',
  `is_agent` tinyint NULL DEFAULT 0 COMMENT '是否参与分销0否1是',
  `alone_grade_equity` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '单独设置折扣的配置',
  `alone_grade_type` tinyint NULL DEFAULT 10 COMMENT '折扣金额类型(10百分比 20固定金额)',
  `product_status` tinyint UNSIGNED NOT NULL DEFAULT 10 COMMENT '产品状态(10上架 20仓库中 30回收站)',
  `view_times` int NULL DEFAULT 0 COMMENT '访问次数',
  `is_virtual` tinyint NULL DEFAULT 0 COMMENT '是否虚拟，0否1是',
  `limit_num` int NULL DEFAULT 0 COMMENT '限购数量0为不限',
  `grade_ids` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT '' COMMENT '可购买会员等级id，逗号隔开',
  `virtual_auto` tinyint NOT NULL DEFAULT 0 COMMENT '是否自动发货1自动0手动',
  `virtual_content` varchar(200) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '虚拟物品内容',
  `is_picture` tinyint NULL DEFAULT 0 COMMENT '详情是否纯图0否1是',
  `table_id` int NULL DEFAULT 0 COMMENT '关联表单id',
  `is_preview` tinyint(1) NOT NULL DEFAULT 0 COMMENT '预告商品1是0否',
  `preview_time` int NOT NULL DEFAULT 0 COMMENT '预告时间',
  `is_delete` tinyint UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否删除',
  `app_id` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '应用id',
  `create_time` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '创建时间',
  `update_time` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '更新时间',
  `shelf_time` int NULL DEFAULT NULL COMMENT '上架时间',
  `PV` int NULL DEFAULT 0 COMMENT '页面访问量',
  `pv_price` decimal(10, 2) UNSIGNED NULL DEFAULT 0.00 COMMENT 'pv价格',
  `UV` int NULL DEFAULT 0 COMMENT '去重访问量',
  `uv_price` decimal(10, 2) NULL DEFAULT 0.00 COMMENT 'uv价格',
  `CPA` int NULL DEFAULT 0,
  `link` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '跳转链接',
  `remark` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '备注',
  `create_user_id` int NULL DEFAULT NULL COMMENT '创建用户id',
  `tags_ids` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '标签ids',
  `admin_url` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '商品管理后台地址',
  `admin_username` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '商品管理后台账号',
  `admin_password` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '商品管理后台密码',
  PRIMARY KEY (`product_id`) USING BTREE,
  INDEX `category_id`(`category_id` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 42 CHARACTER SET = utf8mb3 COLLATE = utf8mb3_general_ci COMMENT = '商品记录表' ROW_FORMAT = COMPACT;

