  `product_sku_id` int UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '产品规格id',
  `product_id` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '产品id',
  `spec_sku_id` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '0' COMMENT '产品sku记录索引 (由规格id组成)',
