  `product_weight` double UNSIGNED NOT NULL DEFAULT 0 COMMENT '产品重量(Kg)',
  `app_id` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '应用id',
  `create_time` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '创建时间',
  `update_time` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '更新时间',
  PRIMARY KEY (`product_sku_id`) USING BTREE,
  UNIQUE INDEX `sku_idx`(`product_id` ASC, `spec_sku_id` ASC) USING BTREE
