  `country` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT '' COMMENT '国家',
  `province` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT '' COMMENT '省份',
  `city` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT '' COMMENT '城市',
  `address_id` int UNSIGNED NULL DEFAULT 0 COMMENT '默认收货地址',
  `balance` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '用户可用余额',
  `points` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '用户可用积分',
  `pay_money` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '用户总支付的金额',
  `expend_money` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '实际消费的金额(不含退款)',
  `grade_id` int UNSIGNED NOT NULL DEFAULT 1 COMMENT '会员等级id',
  `referee_id` int NOT NULL DEFAULT 0 COMMENT '推荐人id',
  `total_points` int NULL DEFAULT 0 COMMENT '累计积分',
  `total_invite` int NULL DEFAULT 0 COMMENT '总邀请人数',
  `freeze_money` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '已冻结佣金',
  `cash_money` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '累积提现佣金',
  `is_delete` tinyint UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否删除',
  `app_id` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '小程序id',
  `create_time` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '创建时间',
  `update_time` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '更新时间',
  `real_name` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '真实姓名',
  `wx_number` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '微信号',
  PRIMARY KEY (`user_id`) USING BTREE,
  INDEX `openid`(`open_id` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb3 COLLATE = utf8mb3_general_ci COMMENT = '用户记录表' ROW_FORMAT = COMPACT;

